// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CreateClientForm from './components/create/CreateClientForm';
import AtendimentoList from './components/atendimentos/AtendimentosList';
import CreateAtendimento from './components/atendimentos/createAtend/CreateAtendimento'; // Importe o componente CreateAtendimento
import AtualizarAtendimento from './components/atendimentos/update/AtualizarAtendimento';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/criar-cliente" element={<CreateClientForm />} />
        <Route path="/atendimento" element={<AtendimentoList />} />
        <Route path="/criar-atendimento" element={<CreateAtendimento />} />
        <Route path="/atualizar-atendimento/:id" element={<AtualizarAtendimento />} />
      </Routes>
    </Router>
  );
};

export default App;
